def five_div_seq(n):
    digit = ''
    seq = []
    for num in range(min(n, 1000), 100, -18):
        if num % 9 == 0 or num % 14 == 0:
            if digit in str(num):
                seq.append(num)
    result = sum((s.count(digit) for s in map(str, seq)))
    return result

